Business process management

{{More citations needed|date=June 2023}}
{{Short description|Business management discipline}}
{{for|related subjects|Process management (disambiguation)}}
{{Use dmy dates|date=August 2019}}
{{Business administration}}
'''Business process management''' ('''BPM''') is the discipline in which people use various methods to [[Business process discovery|discover]], [[Business process modeling|model]], [[Business analysis|analyze]], measure, improve, optimize, and [[Business process automation|automate]] [[business processes]]. Any combination of methods used to manage a company's business processes is BPM. Processes can be structured and repeatable or unstructured and variable. Though not required, enabling [[technologies]] are often used with BPM.

As an approach, BPM sees processes as important assets of an organization that must be understood, managed, and developed to announce and deliver value-added products and services to clients or customers. This approach closely resembles other [[total quality management]] or [[continual improvement process]] methodologies.

[[ISO 9000]] promotes the process approach to managing an [[organization]].
<blockquote> ...promotes the adoption of a process approach when developing, implementing and
improving the effectiveness of a [[quality management]] system, to enhance [[customer satisfaction]] by meeting [[customer requirement]]s.</blockquote>

BPM proponents also claim that this approach can be supported, or enabled, through technology. As such, many BPM articles and scholars frequently discuss BPM from one of two viewpoints: people and/or technology.

BPM streamlines business processing by automating workflows; while [[Robotic process automation|RPA]] automates tasks by recording a set of repetitive activities implemented by human. Organizations maximize their business automation leveraging both technologies to achieve better results.

Large language model

{{Short description|Neural network with billions of weights}}
{{Machine learning|Artificial neural network}}
A '''large language model''' ('''LLM''') is a [[language model]] characterized by its large size. Their size is enabled by [[AI accelerator]]s, which are able to process vast amounts of [[Text corpus|text data]], mostly [[Web scraping|scraped]] from the Internet. The [[artificial neural network]]s which are built can contain from tens of millions and up to billions of weights and are (pre-)trained using [[self-supervised learning]] and [[semi-supervised learning]]. [[Transformer (machine learning model)|Transformer]] architecture contributed to faster training. Alternative architectures include the [[mixture of experts]] (MoE), which has been proposed by Google, starting with sparsely-gated ones in 2017, Gshard in 2021 to GLaM in 2022.<ref name="glam-blog" />

As language models, they work by taking an input text and repeatedly predicting the next token or word. Up to 2020, [[Fine-tuning (machine learning)|fine tuning]] was the only way a model could be adapted to be able to accomplish specific tasks. Larger sized models, such as [[GPT-3]], however, can be [[prompt engineering|prompt-engineered]] to achieve similar results. They are thought to acquire [[Tacit knowledge#Embodied knowledge|embodied knowledge]] about syntax, semantics and "ontology" inherent in human language corpora, but also inaccuracies and biases present in the corpora.

Notable examples include [[OpenAI]]'s [[Generative_pre-trained_transformer|GPT]] models (e.g., [[GPT-3.5]] and [[GPT-4]], used in [[ChatGPT]]), [[Google]]'s [[PaLM]] (used in [[Google Bard|Bard]]), and [[Meta Platforms|Meta]]'s [[LLaMA|LLaMa]], as well as [[BLOOM (language model)|BLOOM]], [[Ernie Bot|Ernie 3.0 Titan]], and [[Anthropic#Claude|Claude]].

