Natural language processing

{{Short description|Field of linguistics and computer science}}
{{Other uses|NLP (disambiguation){{!}}NLP}}
{{About|natural language processing done by computers|the natural language processing done by the human brain|Language processing in the brain}}'''Natural language processing''' ('''NLP''') is an [[interdisciplinary]] subfield of [[computer science]] and [[linguistics]]. It is primarily concerned with giving computers the ability to support and manipulate speech. It involves processing [[natural language]] datasets, such as [[text corpus|text corpora]] or speech corpora, using either rule-based or probabilistic (i.e. statistical and, most recently, neural network-based) [[machine learning]] approaches. The goal is a computer capable of "understanding" the contents of documents, including the [[context (language use)|contextual]] nuances of the language within them. The technology can then accurately extract information and insights contained in the documents as well as categorize and organize the documents themselves.

Challenges in natural language processing frequently involve [[speech recognition]], [[natural-language understanding]], and [[natural language generation|natural-language generation]].

Optical character recognition

{{Short description|Computer recognition of visual text}}
{{EngvarB|date=January 2019}}
{{Use mdy dates|date=January 2019}}
[[File:Portable scanner and OCR (video).webm|thumb|300px|Video of the process of scanning and real-time optical character recognition (OCR) with a portable scanner]]

'''Optical character recognition''' or '''optical character reader''' ('''OCR''') is the [[electronics|electronic]] or [[machine|mechanical]] conversion of [[image]]s of typed, handwritten or printed text into machine-encoded text, whether from a scanned document, a photo of a document, a scene photo (for example the text on signs and billboards in a landscape photo) or from subtitle text superimposed on an image (for example: from a television broadcast).

Widely used as a form of [[data entry]] from printed paper data records{{snd}}whether passport documents, invoices, [[bank statement]]s, computerized receipts, business cards, mail, printed data, or any suitable documentation{{snd}}it is a common method of digitizing printed texts so that they can be electronically edited, searched, stored more compactly, displayed online, and used in machine processes such as [[cognitive computing]], [[machine translation]], (extracted) [[text-to-speech]], key data and [[text mining]]. OCR is a field of research in [[pattern recognition]], [[artificial intelligence]] and [[computer vision]].

Early versions needed to be trained with images of each character, and worked on one font at a time. Advanced systems capable of producing a high degree of accuracy for most fonts are now common, and with support for a variety of [[image file format]] inputs. Some systems are capable of reproducing formatted output that closely approximates the original page including images, columns, and other non-textual components.

Optical character recognition

==Unicode==

{{Main|Optical Character Recognition (Unicode block)}}

Characters to support OCR were added to the [[Unicode]] Standard in June 1993, with the release of version 1.1.

Some of these characters are mapped from fonts specific to [[MICR]], [[OCR-A]] or [[OCR-B]].
